INSERT INTO `services` VALUES (1,1,'Restauration','Venez savourer une pause gourmande dans nos restaurants ! Que vous soyez amateur de plats traditionnels ou de nouvelles saveurs, nos menus vari√©s sauront satisfaire toutes les envies. Profitez d\'un cadre convivial et d√©tendu, id√©al pour recharger vos batteries entre deux visites des animaux. Petits et grands, laissez-vous tenter par nos d√©licieux repas pr√©par√©s avec des ingr√©dients frais et de qualit√©. Bon app√©tit !','2024-06-16 10:11:04','2024-06-16 10:11:04'),(2,1,'Visite guid√©e (gratuite)','D√©couvrez le zoo comme jamais auparavant avec nos visites guid√©es gratuites ! Accompagn√© de nos experts passionn√©s, plongez dans l\'univers fascinant des animaux et apprenez des anecdotes surprenantes sur leurs habitudes et leurs habitats. C\'est une occasion unique d\'en savoir plus sur la biodiversit√© tout en vous amusant. Ne manquez pas cette exp√©rience enrichissante et captivante pour toute la famille !','2024-06-16 10:11:04','2024-06-16 10:11:04'),(3,1,'Visite petit train','Embarquez pour une aventure unique √† bord de notre petit train et explorez le zoo d\'une mani√®re amusante et relaxante ! Pour seulement 5‚Ç¨, laissez-vous guider √† travers les diff√©rents habitats et observez de pr√®s les animaux dans leur environnement naturel. C\'est une fa√ßon id√©ale de d√©couvrir le zoo sans fatigue et de profiter d\'une vue panoramique. Une exp√©rience incontournable pour petits et grands !','2024-06-16 10:11:04','2024-06-16 10:11:04');
/*!40000 ALTER TABLE `services` ENABLE KEYS */;
